import { useState, useEffect } from "react";

function Data() {
    const [launchesApi, setlaunches] = useState([]);
    const launchesData = [
        {
            id: 1,
            rocket: "",
            misionName: "",
            time: ""
        },
        {
            id: 2,
            rocket: "",
            misionName: "",
            time: ""
        },
        {
            id: 3,
            rocket: "",
            misionName: "",
            time: ""
        }
    ];

    useEffect(() => {fetch('https://lldev.thespacedevs.com/2.0.0/launch/upcoming/')
      .then(res => res.json())
      .then(data => {setlaunches(data)})
    }, []);
    console.log(launchesApi);

    // for (const i of Array(10).keys()) {
    //     console.log(launchesApi.results)
    // }
    var x = launchesApi.results
    console.log(x)
    x.forEach(launch => {
        console.log(launch)
    });
    
    return(launchesData);
}

export default Data;
